/*
2945. Find Maximum Non-decreasing Array Length
Hard
Topics
Companies
Hint

You are given a 0-indexed integer array nums.

You can perform any number of operations, where each operation involves selecting a subarray of the array and replacing it with the sum of its elements. For example, if the given array is [1,3,5,6] and you select subarray [3,5] the array will convert to [1,8,6].

Return the maximum length of a non-decreasing array that can be made after applying operations.

A subarray is a contiguous non-empty sequence of elements within an array.



Example 1:

Input: nums = [5,2,2]
Output: 1
Explanation: This array with length 3 is not non-decreasing.
We have two ways to make the array length two.
First, choosing subarray [2,2] converts the array to [5,4].
Second, choosing subarray [5,2] converts the array to [7,2].
In these two ways the array is not non-decreasing.
And if we choose subarray [5,2,2] and replace it with [9] it becomes non-decreasing.
So the answer is 1.

Example 2:

Input: nums = [1,2,3,4]
Output: 4
Explanation: The array is non-decreasing. So the answer is 4.

Example 3:

Input: nums = [4,3,2,6]
Output: 3
Explanation: Replacing [3,2] with [5] converts the given array to [4,5,6] that is non-decreasing.
Because the given array is not non-decreasing, the maximum possible answer is 3.



Constraints:

    1 <= nums.length <= 10^5
    1 <= nums[i] <= 10^5

*/

#include <iostream>
#include <vector>
#include <cassert>
#include <algorithm>
#include <map>
#include <chrono>

using namespace std;

#define __DEBUG_LOG 0

void printVector(vector<int> &nums)
{
    for (size_t i = 0; i < nums.size(); i++)
    {
        cout << nums[i] << " ";
    }
    cout << endl;
}

class Solution
{
    size_t end;
    vector<map<int, int>> dp;

public:
    int findMaximumLength(vector<int> &nums)
    {
        dp.clear();
        dp.resize(nums.size() + 1);
        end = nums.size();
        return 1 + process(nums, 1, nums[0]);
    }
    int process(vector<int> &nums, size_t i, int lastSum)
    {
        if (i >= end)
        {
            return 0;
        }
        if (i == end - 1)
        {
            if (lastSum <= nums[i])
            {
                return 1;
            }
            else
                return 0;
        }

        if (dp[i].size() != 0)
        {
            auto itr = dp[i].lower_bound(lastSum);
            if (itr->first == lastSum)
                return dp[i][lastSum];
            if (lastSum > itr->first)
            {
                if (itr->second == 0 || itr->second == 1)
                    return itr->second;
            }
        }

        int p1, p2, p3;
        p1 = p2 = p3 = 0;
        int maxlen = 0;
        // in line with expectation
        if (nums[i] >= lastSum)
        {
            p1 = 1 + process(nums, i + 1, nums[i]);
            maxlen = max(maxlen, p1);
        }
        else
        {
            int cursum = 0;
            size_t j = i;
            for (; lastSum > cursum && j < end; j++)
            {
                cursum += nums[j];
            }
            if (cursum >= lastSum)
            {
                p2 = 1 + process(nums, j, cursum);
                maxlen = max(maxlen, p2);
            }
        }
        // add to previous
        p3 = process(nums, i + 1, lastSum + nums[i]);
        maxlen = max(maxlen, p3);

        if (__DEBUG_LOG)
        {
            cout << "Processed @" << i << " lastSum " << lastSum << " maxlen " << maxlen
                 << " ( " << p1 << " " << p2 << " " << p3 << ")" << endl;
        }
        dp[i][lastSum] = maxlen;
        return maxlen;
    }
};

void test1(int testID)
{
    Solution s;
    cout << "test" << testID << endl;
    auto nums = vector<vector<int>>({{5, 2, 2},
                                     {1, 2, 3, 4},
                                     {4, 3, 2, 6},
                                     {103, 652, 579},
                                     {247, 173, 316},
                                     {425, 35, 409, 368, 476},
                                     {671, 564, 873, 793},
                                     {520, 531, 573, 65, 426, 501, 95}});

    vector<int> expected = {
        1,
        4,
        3,
        2,
        2,
        3,
        2,
        5};

    for (size_t i = 0; i < nums.size(); i++)
    // for (size_t i = nums.size() - 1; i < nums.size(); i++)
    {
        cout << "loop:" << i << endl;

        printVector(nums[i]);
        cout << " " << endl;

        auto result = s.findMaximumLength(nums[i]);
        cout << result << " " << expected[i] << endl;
        assert(result == expected[i]);
    }
}

